(1, 12, 'Accessories', 'https://learnenglish.britishcouncil.org/en/vocabulary-exercises/accessories', 1, 'Do the exercises and learn the words for some accessories.', '{\"vi\":\"Ph\\u1ee5 ki\\u1ec7n\",\"ko\":\"\\ubd80\\uc18d\\ud488\",\"fr\":\"Accessoires\",\"es\":\"Accesorios\",\"pt\":\"Acess\\u00f3rios\",\"nl\":\"Accessoires\",\"zh-CN\":\"\\u9970\\u54c1\",\"zh-TW\":\"\\u98fe\\u54c1\",\"ja\":\"\\u30a2\\u30af\\u30bb\\u30b5\\u30ea\\u30fc\",\"it\":\"Accessori\",\"th\":\"\\u0e2d\\u0e38\\u0e1b\\u0e01\\u0e23\\u0e13\\u0e4c\",\"id\":\"Aksesoris\"}', 1, '2018-03-14 12:45:06', '2018-03-15 00:54:14'),
(2, 12, 'Actions', 'https://learnenglish.britishcouncil.org/en/vocabulary-exercises/actions', 1, 'Do the exercises and learn the words for some common actions.', '{\"vi\":\"H\\u00e0nh \\u0111\\u1ed9ng\",\"ko\":\"\\ud589\\uc704\",\"fr\":\"actes\",\"es\":\"Comportamiento\",\"pt\":\"A\\u00e7\\u00f5es\",\"nl\":\"acties\",\"zh-CN\":\"\\u64cd\\u4f5c\",\"zh-TW\":\"\\u64cd\\u4f5c\",\"ja\":\"\\u884c\\u52d5\",\"it\":\"Azioni\",\"th\":\"\\u0e01\\u0e32\\u0e23\\u0e1b\\u0e0f\\u0e34\\u0e1a\\u0e31\\u0e15\\u0e34\",\"id\":\"Tindakan\"}', 1, '2018-03-14 12:45:06', '2018-03-15 00:54:57'),
(3, 12, 'Air travel', 'https://learnenglish.britishcouncil.org/en/vocabulary-exercises/air-travel', 1, 'Do the exercises to improve your vocabulary for air travel.', '{\"vi\":\"Du l\\u1ecbch h\\u00e0ng kh\\u00f4ng\",\"ko\":\"\\ube44\\ud589\\uae30 \\uc5ec\\ud589\",\"fr\":\"Voyage en avion\",\"es\":\"Viaje a\\u00e9reo\",\"pt\":\"Viagem a\\u00e9rea\",\"nl\":\"Vliegreizen\",\"zh-CN\":\"\\u822a\\u7a7a\\u65c5\\u884c\",\"zh-TW\":\"\\u822a\\u7a7a\\u65c5\\u884c\",\"ja\":\"\\u7a7a\\u306e\\u65c5\",\"it\":\"Trasporto aereo\",\"th\":\"\\u0e01\\u0e32\\u0e23\\u0e40\\u0e14\\u0e34\\u0e19\\u0e17\\u0e32\\u0e07\\u0e17\\u0e32\\u0e07\\u0e2d\\u0e32\\u0e01\\u0e32\\u0e28\",\"id\":\"Perjalanan udara\"}', 1, '2018-03-14 12:45:06', '2018-03-15 00:55:26'),
(4, 12, 'Appearance 1', 'https://learnenglish.britishcouncil.org/en/vocabulary-exercises/appearance-1', 1, 'Do the exercises to learn words to describe people\'s appearance.', '{\"vi\":\"Xu\\u1ea5t hi\\u1ec7n 1\",\"ko\":\"\\uc678\\uad00 1\",\"fr\":\"Apparence 1\",\"es\":\"Apariencia 1\",\"pt\":\"Apar\\u00eancia 1\",\"nl\":\"Uiterlijk 1\",\"zh-CN\":\"\\u5916\\u89c21\",\"zh-TW\":\"\\u5916\\u89c01\",\"ja\":\"\\u5916\\u89b31\",\"it\":\"Aspetto 1\",\"th\":\"\\u0e25\\u0e31\\u0e01\\u0e29\\u0e13\\u0e30\\u0e17\\u0e35\\u0e48\\u0e1b\\u0e23\\u0e32\\u0e01\\u0e0f 1\",\"id\":\"Penampilan 1\"}', 1, '2018-03-14 12:45:06', '2018-03-15 00:55:31'),
(5, 12, 'Appearance 2', 'https://learnenglish.britishcouncil.org/en/vocabulary-exercises/appearance-2', 1, 'Do you know what a \'toddler\' is? Do these exercises and learn this and other words to talk about people\'s appearance.', '{\"vi\":\"Xu\\u1ea5t hi\\u1ec7n 2\",\"ko\":\"\\ubaa8\\uc591 2\",\"fr\":\"Apparence 2\",\"es\":\"Apariencia 2\",\"pt\":\"Apar\\u00eancia 2\",\"nl\":\"Uiterlijk 2\",\"zh-CN\":\"\\u5916\\u89c22\",\"zh-TW\":\"\\u5916\\u89c02\",\"ja\":\"\\u5916\\u89b32\",\"it\":\"Aspetto 2\",\"th\":\"\\u0e25\\u0e31\\u0e01\\u0e29\\u0e13\\u0e30\\u0e17\\u0e35\\u0e48\\u0e1b\\u0e23\\u0e32\\u0e01\\u0e0f 2\",\"id\":\"Penampilan 2\"}', 1, '2018-03-14 12:45:06', '2018-03-15 00:55:35'),
(6, 12, 'Around town', 'https://learnenglish.britishcouncil.org/en/vocabulary-exercises/around-town', 1, 'What\'s the difference between a \'crossing\' and a \'crossroads\'? Do these exercises to help learn words for the things around your town and find out!', '{\"vi\":\"Xung quanh th\\u1ecb tr\\u1ea5n\",\"ko\":\"\\ub9c8\\uc744 \\uadfc\\ucc98\",\"fr\":\"Autour de la ville\",\"es\":\"Alrededor del pueblo\",\"pt\":\"\\u00c0 volta da cidade\",\"nl\":\"Rond de stad\",\"zh-CN\":\"\\u57ce\\u9547\\u5468\\u56f4\",\"zh-TW\":\"\\u57ce\\u93ae\\u5468\\u570d\",\"ja\":\"\\u753a\\u306e\\u5468\\u308a\",\"it\":\"In giro per la citt\\u00e0\",\"th\":\"\\u0e23\\u0e2d\\u0e1a\\u0e40\\u0e21\\u0e37\\u0e2d\\u0e07\",\"id\":\"Di sekitar kota\"}', 1, '2018-03-14 12:45:06', '2018-03-15 00:55:37'),
(7, 12, 'Bathrooms', 'https://learnenglish.britishcouncil.org/en/vocabulary-exercises/bathrooms', 1, 'Learn words for things in bathrooms by doing these exercises.', '{\"vi\":\"Ph\\u00f2ng t\\u1eafm\",\"ko\":\"\\uc695\\uc2e4\",\"fr\":\"Les salles\",\"es\":\"Ba\\u00f1os\",\"pt\":\"Banheiros\",\"nl\":\"badkamers\",\"zh-CN\":\"\\u6d74\\u5ba4\",\"zh-TW\":\"\\u6d74\\u5ba4\",\"ja\":\"\\u30d0\\u30b9\\u30eb\\u30fc\\u30e0\",\"it\":\"bagni\",\"th\":\"\\u0e2b\\u0e49\\u0e2d\\u0e07\\u0e19\\u0e49\\u0e33\",\"id\":\"Kamar mandi\"}', 1, '2018-03-14 12:45:06', '2018-03-15 00:55:40'),
(8, 12, 'Beaches', 'https://learnenglish.britishcouncil.org/en/vocabulary-exercises/beaches', 1, 'Are you ready to go to the beach? Do these exercises and learn vocabulary to talk about the beach.', '{\"vi\":\"B\\u00e3i bi\\u1ec3n\",\"ko\":\"\\ud574\\ubcc0\\ub4e4\",\"fr\":\"Des plages\",\"es\":\"Playas\",\"pt\":\"Praias\",\"nl\":\"stranden\",\"zh-CN\":\"\\u6d77\\u6ee9\",\"zh-TW\":\"\\u6d77\\u7058\",\"ja\":\"\\u30d3\\u30fc\\u30c1\",\"it\":\"Spiagge\",\"th\":\"\\u0e0a\\u0e32\\u0e22\\u0e2b\\u0e32\\u0e14\",\"id\":\"Pantai\"}', 1, '2018-03-14 12:45:06', '2018-03-15 00:55:42'),
(9, 12, 'Bedrooms', 'https://learnenglish.britishcouncil.org/en/vocabulary-exercises/bedrooms', 1, 'Do these exercises to learn words to talk about your bedroom.', '{\"vi\":\"Ph\\u00f2ng ng\\u1ee7\",\"ko\":\"\\uce68\\uc2e4\",\"fr\":\"Chambres\",\"es\":\"Dormitorios\",\"pt\":\"Quartos de dormir\",\"nl\":\"slaapkamers\",\"zh-CN\":\"\\u5367\\u5ba4\",\"zh-TW\":\"\\u81e5\\u5ba4\",\"ja\":\"\\u30d9\\u30c3\\u30c9\\u30eb\\u30fc\\u30e0\",\"it\":\"Camere da letto\",\"th\":\"\\u0e2b\\u0e49\\u0e2d\\u0e07\\u0e19\\u0e2d\\u0e19\",\"id\":\"Kamar tidur\"}', 1, '2018-03-14 12:45:06', '2018-03-15 00:55:44'),
(10, 12, 'Bicycles and motorbikes', 'https://learnenglish.britishcouncil.org/en/vocabulary-exercises/bicycles-and-motorbikes', 1, 'How often do you ride a bicycle or motorbike? Learn some vocabulary for speaking about your bike by doing these exercises.', '{\"vi\":\"Xe \\u0111\\u1ea1p v\\u00e0 xe m\\u00e1y\",\"ko\":\"\\uc790\\uc804\\uac70 \\ubc0f \\uc624\\ud1a0\\ubc14\\uc774\",\"fr\":\"Bicyclettes et motos\",\"es\":\"Bicicletas y motos\",\"pt\":\"Bicicletas e motos\",\"nl\":\"Fietsen en motorfietsen\",\"zh-CN\":\"\\u81ea\\u884c\\u8f66\\u548c\\u6469\\u6258\\u8f66\",\"zh-TW\":\"\\u81ea\\u884c\\u8eca\\u548c\\u6469\\u6258\\u8eca\",\"ja\":\"\\u81ea\\u8ee2\\u8eca\\u3068\\u30d0\\u30a4\\u30af\",\"it\":\"Biciclette e motocicli\",\"th\":\"\\u0e08\\u0e31\\u0e01\\u0e23\\u0e22\\u0e32\\u0e19\\u0e41\\u0e25\\u0e30\\u0e23\\u0e16\\u0e08\\u0e31\\u0e01\\u0e23\\u0e22\\u0e32\\u0e19\\u0e22\\u0e19\\u0e15\\u0e4c\",\"id\":\"Sepeda dan sepeda motor\"}', 1, '2018-03-14 12:45:06', '2018-03-15 00:55:50'),
(11, 12, 'Body parts 1', 'https://learnenglish.britishcouncil.org/en/vocabulary-exercises/body-parts-1', 1, 'Do these exercises to learn words for parts of the body.', '{\"vi\":\"Ph\\u1ea7n c\\u01a1 th\\u1ec3 1\",\"ko\":\"\\uc2e0\\uccb4 \\ubd80\\uc704 1\",\"fr\":\"Parties du corps 1\",\"es\":\"Partes del cuerpo 1\",\"pt\":\"Partes do corpo 1\",\"nl\":\"Lichaamsdelen 1\",\"zh-CN\":\"\\u8eab\\u4f53\\u90e8\\u4f4d1\",\"zh-TW\":\"\\u8eab\\u9ad4\\u90e8\\u4f4d1\",\"ja\":\"\\u30dc\\u30c7\\u30a3\\u30d1\\u30fc\\u30c41\",\"it\":\"Parti del corpo 1\",\"th\":\"\\u0e2a\\u0e48\\u0e27\\u0e19\\u0e02\\u0e2d\\u0e07\\u0e23\\u0e48\\u0e32\\u0e07\\u0e01\\u0e32\\u0e22 1\",\"id\":\"Bagian tubuh 1\"}', 1, '2018-03-14 12:45:06', '2018-03-15 00:55:54'),
(12, 12, 'Body parts 2', 'https://learnenglish.britishcouncil.org/en/vocabulary-exercises/body-parts-2', 1, 'What\'s the difference between your thumbs and your toes? Do these exercises to find out and to learn vocabulary for more body parts.', '{\"vi\":\"Ph\\u1ea7n c\\u01a1 th\\u1ec3 2\",\"ko\":\"\\uc2e0\\uccb4 \\ubd80\\uc704 2\",\"fr\":\"Parties du corps 2\",\"es\":\"Partes del cuerpo 2\",\"pt\":\"Partes do corpo 2\",\"nl\":\"Lichaamsdelen 2\",\"zh-CN\":\"\\u8eab\\u4f53\\u90e8\\u4f4d2\",\"zh-TW\":\"\\u8eab\\u9ad4\\u90e8\\u4f4d2\",\"ja\":\"\\u30dc\\u30c7\\u30a3\\u30d1\\u30fc\\u30c42\",\"it\":\"Parti del corpo 2\",\"th\":\"\\u0e2a\\u0e48\\u0e27\\u0e19\\u0e02\\u0e2d\\u0e07\\u0e23\\u0e48\\u0e32\\u0e07\\u0e01\\u0e32\\u0e22 2\",\"id\":\"Bagian tubuh 2\"}', 1, '2018-03-14 12:45:06', '2018-03-15 00:55:59'),
(13, 12, 'Cars', 'https://learnenglish.britishcouncil.org/en/vocabulary-exercises/cars', 1, 'Do these exercises to learn words related to cars.', '{\"vi\":\"\\u00d4 t\\u00f4\",\"ko\":\"\\uc790\\ub3d9\\ucc28\",\"fr\":\"Des voitures\",\"es\":\"Carros\",\"pt\":\"Carros\",\"nl\":\"Cars\",\"zh-CN\":\"\\u6c7d\\u8f66\",\"zh-TW\":\"\\u6c7d\\u8eca\",\"ja\":\"\\u8eca\",\"it\":\"Automobili\",\"th\":\"\\u0e23\\u0e16\",\"id\":\"Mobil\"}', 1, '2018-03-14 12:45:06', '2018-03-15 00:56:00'),
(14, 12, 'Christmas in the UK', 'https://learnenglish.britishcouncil.org/en/vocabulary-exercises/christmas-uk', 1, 'Happy Christmas! Do these exercises and learn words to talk about Christmas in the UK.', '{\"vi\":\"Gi\\u00e1ng sinh \\u1edf Anh\",\"ko\":\"\\uc601\\uad6d\\uc758 \\ud06c\\ub9ac\\uc2a4\\ub9c8\\uc2a4\",\"fr\":\"No\\u00ebl au Royaume-Uni\",\"es\":\"Navidad en el Reino Unido\",\"pt\":\"Natal no Reino Unido\",\"nl\":\"Kerstmis in het VK\",\"zh-CN\":\"\\u5723\\u8bde\\u8282\\u5728\\u82f1\\u56fd\",\"zh-TW\":\"\\u8056\\u8a95\\u7bc0\\u5728\\u82f1\\u570b\",\"ja\":\"\\u30a4\\u30ae\\u30ea\\u30b9\\u306e\\u30af\\u30ea\\u30b9\\u30de\\u30b9\",\"it\":\"Natale nel Regno Unito\",\"th\":\"\\u0e04\\u0e23\\u0e34\\u0e2a\\u0e15\\u0e4c\\u0e21\\u0e32\\u0e2a\\u0e43\\u0e19\\u0e2a\\u0e2b\\u0e23\\u0e32\\u0e0a\\u0e2d\\u0e32\\u0e13\\u0e32\\u0e08\\u0e31\\u0e01\\u0e23\",\"id\":\"Natal di Inggris\"}', 1, '2018-03-14 12:45:06', '2018-03-15 00:56:06'),
(15, 12, 'Clothes 1', 'https://learnenglish.britishcouncil.org/en/vocabulary-exercises/clothes-1', 1, 'Do the exercises to learn words for different kinds of clothes.', '{\"vi\":\"Qu\\u1ea7n \\u00e1o 1\",\"ko\":\"\\uc637 1\",\"fr\":\"V\\u00eatements 1\",\"es\":\"Ropa 1\",\"pt\":\"Roupas 1\",\"nl\":\"Kleren 1\",\"zh-CN\":\"\\u8863\\u670d1\",\"zh-TW\":\"\\u8863\\u670d1\",\"ja\":\"\\u670d1\",\"it\":\"Vestiti 1\",\"th\":\"\\u0e40\\u0e2a\\u0e37\\u0e49\\u0e2d\\u0e1c\\u0e49\\u0e32 1\",\"id\":\"Pakaian 1\"}', 1, '2018-03-14 12:45:06', '2018-03-15 00:56:11'),
(16, 12, 'Clothes 2', 'https://learnenglish.britishcouncil.org/en/vocabulary-exercises/clothes-2', 1, 'Do the exercises to learn vocabulary to talk about clothes.', '{\"vi\":\"Qu\\u1ea7n \\u00e1o 2\",\"ko\":\"\\uc637 2\",\"fr\":\"V\\u00eatements 2\",\"es\":\"Ropa 2\",\"pt\":\"Roupa 2\",\"nl\":\"Kleding 2\",\"zh-CN\":\"\\u8863\\u670d2\",\"zh-TW\":\"\\u8863\\u670d2\",\"ja\":\"\\u670d2\",\"it\":\"Vestiti 2\",\"th\":\"\\u0e40\\u0e2a\\u0e37\\u0e49\\u0e2d\\u0e1c\\u0e49\\u0e32 2\",\"id\":\"Pakaian 2\"}', 1, '2018-03-14 12:45:06', '2018-03-15 00:56:15'),
