(18, 11, 'Containers', 'https://learnenglish.britishcouncil.org/en/vocabulary-exercises/containers', 1, 'Learn words for different containers by doing these exercises.', '{\"vi\":\"H\\u1ed9p \\u0111\\u1ef1ng\",\"ko\":\"\\ucee8\\ud14c\\uc774\\ub108\",\"fr\":\"Conteneurs\",\"es\":\"Contenedores\",\"pt\":\"Containers\",\"nl\":\"containers\",\"zh-CN\":\"\\u96c6\\u88c5\\u7bb1\",\"zh-TW\":\"\\u96c6\\u88dd\\u7bb1\",\"ja\":\"\\u30b3\\u30f3\\u30c6\\u30ca\",\"it\":\"contenitori\",\"th\":\"\\u0e15\\u0e39\\u0e49\\u0e04\\u0e2d\\u0e19\\u0e40\\u0e17\\u0e19\\u0e40\\u0e19\\u0e2d\\u0e23\\u0e4c\",\"id\":\"Kontainer\"}', 1, '2018-03-14 12:45:06', '2018-03-15 00:56:20'),
(19, 12, 'Daily routine', 'https://learnenglish.britishcouncil.org/en/vocabulary-exercises/daily-routine', 1, 'Do the exercises and learn how to talk about what you do every day.', '{\"vi\":\"Th\\u00f3i quen h\\u00e0ng ng\\u00e0y\",\"ko\":\"\\uc77c\\uc0c1 \\uc5c5\\ubb34\",\"fr\":\"Routine quotidienne\",\"es\":\"Rutina diaria\",\"pt\":\"Rotina di\\u00e1ria\",\"nl\":\"Dagelijkse routine\",\"zh-CN\":\"\\u65e5\\u5e38\\u751f\\u6d3b\",\"zh-TW\":\"\\u65e5\\u5e38\\u751f\\u6d3b\",\"ja\":\"\\u6bce\\u65e5\\u306e\\u30eb\\u30fc\\u30c1\\u30f3\",\"it\":\"Routine quotidiana\",\"th\":\"\\u0e01\\u0e34\\u0e08\\u0e27\\u0e31\\u0e15\\u0e23\\u0e1b\\u0e23\\u0e30\\u0e08\\u0e33\\u0e27\\u0e31\\u0e19\",\"id\":\"Rutinitas harian\"}', 1, '2018-03-14 12:45:06', '2018-03-15 00:56:25'),
